import React, { useContext } from "react";
import {
  BoldLink,
  BoxContainer,
  FormContainer,
  Input,
  MutedLink,
  SubmitButton,
} from "./common";
import { Marginer } from "../marginer";
import { AccountContext } from "./accountContext";


export function SignupForm(props) {
  const { switchToSignin } = useContext(AccountContext);

  return (
    <BoxContainer>
      <FormContainer onsubmit="enviar()">
  
         <Input icon="user" type="text" name="nombre" id="nombre" placeholder="Nombre" />
        <Input type="text" name="apellido" id="apellido" placeholder="Apellido" />
        <Input type="email" name="correo" id="correo" placeholder="Correo" />
        <Input type="number" name="telefono" id="telefono" placeholder="Telefóno"/>
        <Input type="texto" name="direccion" id="direccion" placeholder="Dirección"/>
        <Input type="password" name="pass" id="pass"  placeholder="Contraseña" />
        <Input type="password" placeholder="Confirmar Contraseña" />
      </FormContainer>
      <Marginer direction="vertical" margin={25} />
      <SubmitButton type="submit">Registrarse</SubmitButton>
      <Marginer direction="vertical" margin="1em" />
      <MutedLink href="#">
      ¿Ya tienes una cuenta?
        <BoldLink href="#" onClick={switchToSignin}>
        
        Iniciar sesión
        </BoldLink>
      </MutedLink>
    </BoxContainer>
  );
}
